import React from 'react';
import Navbar from "./Navbar"
import Home from "./pages/Home"
import Prediction from "./pages/Prediction"
import TreatmentOption from "./pages/TreatmentOption"
import AboutUs from "./pages/AboutUs"
import { Route, Routes } from "react-router-dom"
import ChatBot from 'react-simple-chatbot';
import { Button } from 'semantic-ui-react';
import { useState } from 'react';
import './styles.css';


function App() {
  const [minimized, setMinimized] = useState(false);

  const handleToggleMinimize = () => {
    setMinimized(!minimized);
  };
  const steps = [
    {
      id: "Greet",
      message: "Hello There!  Welcome to Chronic Kidney Disease Prediction system",
      trigger: "Help",
    },

    {
      id: "Help",
      message: "Do you want a guidance?",
      trigger: "selection",
    },
    {
      id: "selection",
      options: [
        { value: "Yes", label: "Yes", trigger: "Yes" },
        { value: "No", label: "No", trigger: "No" },
      ],
    },

    {
      id: "No",
      message: "If you need assistance, feel free to ask!",
      end: true
    },
    {
      id: "Yes",
      message: "It's really glad to assist you!",
      trigger: "selection2",
    },

    {
      id: "selection2",
      options: [

        { value: "I don't have an account", label: "I don't have an account", trigger: "I don't have an account"},
        { value: "What are the facilities that the system provides.", label: "What are the facilities that the system provides.", trigger: "What are the facilities that the system provides."},
        { value: "How can i get kidney disease prediction Through this system", label: "How can i get kidney disease prediction Through this system", trigger: "How can i get kidney disease prediction Through this system"},
      ],
    },

    {
      id: "I don't have an account",
      message: "If you don't have an account, then click on 'Register' button, then create username & password and click on 'submit' button.",
      end: true
    },



    {
      id: "What are the facilities that the system provides.",
      message: "Chronic kidney disease prediction panel",
      trigger: "Facility2",
    },
    {
      id: "Facility2",
      message: "Awareness of Chronic Kidney Disease",
      trigger: "Facility3",
    },
    {
      id: "Facility3",
      message: "Treatment Option for Chronic Kidney Disease",
      end: true,
    },

    {
      id: "How can i get kidney disease prediction Through this system",
      message: "First of all, login into the system by using username & password,if you don't have an account get registered, then you can login into the system and go to the tab called get prediction, then after fill the form and click on the 'Prediction' button.",
      end: true
    },



  ];

   return (




  <>


    <Navbar />
    <div className="Container">
        <Routes>
            <Route path="/home" element={<Home />} />  
            <Route path="/prediction" element={<Prediction />} />
            <Route path="/treatmentoption" element={<TreatmentOption />} />
            <Route path="/aboutus" element={<AboutUs />} />
            {/* Nested Routes for prediction page */}
        </Routes>
    </div>

    <div className="home-container">
            <div className="home-content">
                <h1>Chronic Kidney Disease Prediction System</h1>
                <p>We provide advanced prediction models to assess the risk of chronic kidney disease.</p>
                <div className="vision-mission">
                    <h2>Vision</h2>
                    <p>"To pioneer a future where chronic kidney disease is effectively managed through cutting-edge predictive technologies, fostering proactive healthcare and enhancing overall well-being."</p>
                    <h2>Mission</h2>
                    <p>"Our mission is to revolutionize the landscape of chronic kidney disease management by delivering state-of-the-art prediction models. Through continuous innovation and collaboration with healthcare professionals, our goal is to empower individuals with timely insights, enabling early intervention and personalized care pathways. We strive to make a lasting impact on global health by reducing the burden of chronic kidney disease and improving outcomes for all."</p>
                </div>



            </div>

        </div>

    <div style={styles.chatbotContainer}>
      {!minimized && (
        <ChatBot steps={steps} botAvatar="/botavatar.png" />
      )}
      <Button
        icon={minimized ? 'window maximize' : 'window minimize'}
        onClick={handleToggleMinimize}
        style={styles.minimizeButton}
      />
    </div>

</>

    );
}
const styles = {
  chatbotContainer: {
    position: 'fixed',
    bottom: 20,
    right: 20,
    zIndex: 9999, // Ensures the chatbot appears above other elements
  },
  minimizeButton: {
    position: 'absolute',
    top: 0, // Move the button to the top
    right: 0,
    zIndex: 10000, // Ensures the button appears above the chatbot
    height: '20px', // Adjust the height
    width: '50px', // Adjust the width
  },
};  
        export default App;
